import SectionTitle from './components/SectionTitle/SectionTitle';
import AirportCard from './components/AirportCart/AirportCard';
import CarouselNavigation from './components/CarouselNavigation/CarouselNavigation';
import airports from './airports.json';

import AirportSlider from './components/AirportSlider';


function App() {
  return (

	<section className="top-destinations pt-[204px] pb-[108px] bg-[#f6f7f6]">
		<div className="container max-w-[1280px] mx-auto px-8">

      <SectionTitle />

	  <div className="cards  flex gap-6 flex-wrap cursor-pointer">
        {airports.map((airport) => (
          <AirportCard
            key={airport.id}
            image={airport.image}
			title={airport.title}
            city={airport.city}
            price={airport.price}
            currency={airport.currency}
          />
        ))}
      </div>


		<CarouselNavigation/>
   		</div>
	</section>
  );
}

export default App;
